function popitup(loc){
	url='http://'+$(location).attr('host')+'/dsm2.webtools/timeseries_chart.jsp?dssfile=C:/dss-data/DEFAULT_DV.DSS&dsspath=//'+loc
	newwindow=window.open(url,loc,'height=500,width=850, scrollbars=no, resizable=no, location=no, toolbar=no, menubar=no');
	if (window.focus) {newwindow.focus()}
	return false;	
}

$(document).ready(function (){
	var s = Snap(svg2);
	s.click( function (ev) {
		var loc;
		var el;
		if (ev.target.tagName=='polygon'){
			if (ev.target.previousElementSibling != null){
					if (ev.target.previousElementSibling.firstChild != null){
						el = ev.target.previousElementSibling.firstChild
					}
			}
		} else if (ev.target.tagName=='text'){
			el=ev.target;
		}
		loc = el.textContent;
		popitup(loc);
	});
	
})
</script>
